objects.description:
Define apple in the real world. Let's call a function named "Apple" that is to be invoked in a JavaFX program. I'm declaring the function in the class with the name "className" and I'm also passing the name of the class by name.

Apple func = new Apple();

Let's say I create a new Apple instance with the name Apple() and assign the function name "func" to it. In the JavaFX program, will Apple().
